import React from "react";
import Header from "../components/header";
import styles from "./signupResult.module.css";
import { Link } from "react-router-dom";

function Main() {
  return (
    <>
      <Header />
      <div className={styles.signupResultSection}>
        <div className={styles.signupResultWrap}>
          <img src={require("../images/check.png")} alt="check"/>
          <h>님의 회원가입이 완료되었습니다.</h>
          <h>이제 모든 서비스를 이용하실 수 있습니다.</h>
          <div>
            <Link to="/login">
              <button>로그인</button>
            </Link>
            <Link to="/">
              <button>홈으로</button>
            </Link>
          </div>
          
        </div>
      </div>
    </>
  );
}
export default Main;
